package com.saayman.advent2018.day5;


public class Day5Part1And2Solver {

    public static void main(String... args) {
        part1And2();
    }

    private static void part1And2() {
        Polymer part1 = new Polymer(input); //Unstable
        part1.stablize();

        System.out.println("Part1: "+part1.getStableUnits());

        Polymer part2 = new Polymer(input); //Unstable
        part2.determinePreventor();

        System.out.println("Part2: "+part2.getShortestPolymer());
    }

    private static String input = "";
}
